beforeEach(() => {
  cy.viewport(1440, 1440);
  cy.setCookie("bitmemes-user", "funny-eli");
});

it("eliminar un meme", () => {
  cy.intercept(
    {
      method: "GET",
      url: "http://localhost:8000/memes?username=funny-eli",
    },
    {
      statusCode: 200,
      body: [
        {
          title: "cuando el cliente me pide cambios",
          date: "2022-03-10T03:02:07.372Z",
          tag: "javascript",
          image:
            "data:image/webp;base64,",
          id: "278a203ab46",
          likes: 30,
          username: "funny-eli",
        },
        {
          title: "por favor no me pidan CSS",
          date: "2022-03-10T00:35:20.167Z",
          tag: "frontend",
          image:
            "data:image/webp;base64,",
          id: "b81f9b46221",
          likes: 17,
          username: "meme-master-octa",
        },
        {
          title: "what is my purpose?",
          date: "2022-03-10T00:37:32.782Z",
          tag: "frontend",
          image:
            "data:image/webp;base64,",
          id: "1f9b4622153",
          likes: 7,
          username: "meme-master-octa",
        },
      ],
    }
  ).as("getMockBeforeDelete");
  cy.visit("localhost:3000/mis-memes");
  cy.contains("Bienvenidos funny-eli");
  cy.get("[data-testid=meme-admin-card]").should("have.length", 3);
  cy.intercept(
    {
      method: "DELETE",
      url: "http://localhost:8000/memes/1f9b4622153",
    },
    {
      statusCode: 200,
      body: {},
    }
  ).as("putMock");
  cy.intercept(
    {
      method: "GET",
      url: "http://localhost:8000/memes?username=funny-eli",
    },
    {
      statusCode: 200,
      body: [
        {
          title: "cuando el cliente me pide cambios",
          date: "2022-03-10T03:02:07.372Z",
          tag: "javascript",
          image:
            "data:image/webp;base64,",
          id: "278a203ab46",
          likes: 30,
          username: "funny-eli",
        },
        {
          title: "por favor no me pidan CSS",
          date: "2022-03-10T00:35:20.167Z",
          tag: "frontend",
          image:
            "data:image/webp;base64,",
          id: "b81f9b46221",
          likes: 17,
          username: "meme-master-octa",
        },
      ],
    }
  ).as("getMockAfterDelete");
  cy.get("[data-testid=delete-meme]").first().click();
  cy.get("[data-testid=meme-admin-card]").should("have.length", 2);
});

it.only("subir un nuevo meme", () => {
  const filePath = "/images/testMeme.jpeg";
  cy.visit("localhost:3000/mis-memes");
  cy.get('input[type="file"]').attachFile(filePath);
  const currentDate = new Date();
  cy.get("[data-testid=meme-title-input").type(
    `test de integracion ${currentDate}`
  );
  cy.get("[data-testid=meme-submit").click();
  cy.contains(`test de integracion ${currentDate}`);
  cy.get("[data-testid=home-link]").click();
  cy.contains(`test de integracion ${currentDate}`);
});
